// outputScreen.js File 
import React from "react"; // Import React (Mandatory Step). 
import OutputScreenRow from "./outputScreenrow.js"; // Import Output Screen Row. 


const OutputScreen = () => { 
	return ( 
		<div className="screen"> 
			<OutputScreenRow /> 
			<OutputScreenRow /> 
		</div> 
	); 
}; 
export default OutputScreen;
